DROP TABLE IF EXISTS `agency`;
CREATE TABLE `agency` (
  `game_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '游戏账号ID',
  `agency_id` int(11) DEFAULT NULL COMMENT '代理ID',
  `username` varchar(30) DEFAULT NULL COMMENT '游戏账号昵称',
  `real_name` varchar(20) DEFAULT NULL COMMENT '玩家真实姓名',
  `mobile` varchar(20) DEFAULT NULL COMMENT '代理手机号',
  `wechat` varchar(30) DEFAULT NULL COMMENT '代理微信号',
  `gold` int(11) DEFAULT NULL COMMENT '元宝数量',
  `invitation_code` varchar(10) DEFAULT NULL COMMENT '邀请码',
  `level` varchar(20) DEFAULT NULL COMMENT '代理级别',
  `member` int(11) DEFAULT NULL COMMENT '会员数量',
  `create_time` datetime DEFAULT NULL COMMENT '注册代理时间',
  `p_code` varchar(10) DEFAULT NULL COMMENT '上级代理邀请码',
  `p_name` varchar(20) DEFAULT NULL COMMENT '上级代理用户昵称',
  `login_time` datetime DEFAULT NULL COMMENT '最近登录时间',
  `login_ip` varchar(20) DEFAULT NULL COMMENT '最近登录ip',
  `status` smallint(5) DEFAULT '1' COMMENT '代理状态',
  `address` text COMMENT '代理地址',
  `u_member` int(11) DEFAULT NULL COMMENT '下级代理数',
  `rest_money` int(11) DEFAULT NULL COMMENT '可用金额',
  `total_money` int(11) DEFAULT NULL COMMENT '累计金额',
  `record` varchar(255) DEFAULT NULL,
  `bound_time` datetime DEFAULT NULL COMMENT '绑定时间',
  `transfer_id` int(11) DEFAULT NULL COMMENT '关联id',
  `transfer_name` varchar(30) DEFAULT NULL COMMENT '关联昵称',
  `password` varchar(40) DEFAULT NULL,
  `salt` varchar(20) DEFAULT NULL,
  `role_id` int(11) DEFAULT NULL,
  `cart` int(11) unsigned DEFAULT NULL,
  `Commission_one` varchar(20) DEFAULT NULL,
  `Commission_two` varchar(20) DEFAULT NULL,
  `Commission_three` varchar(20) DEFAULT NULL,
  `Commission_four` varchar(20) DEFAULT NULL,
  `Commission_five` varchar(20) DEFAULT NULL,
  `Commission_firm` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`game_id`)
) ENGINE=MyISAM AUTO_INCREMENT=104 DEFAULT CHARSET=utf8;

