# Structure for table "auth"
#

DROP TABLE IF EXISTS `auth`;
CREATE TABLE `auth` (
  `is_menu` smallint(6) DEFAULT NULL,
  `auth_id` smallint(6) unsigned NOT NULL AUTO_INCREMENT COMMENT '权限ID',
  `auth_name` varchar(20) NOT NULL COMMENT '权限名称',
  `auth_pid` smallint(6) unsigned NOT NULL COMMENT '父级ID',
  `auth_controller` varchar(32) NOT NULL DEFAULT '' COMMENT '控制器名称',
  `auth_action` varchar(32) NOT NULL DEFAULT '' COMMENT '操作方法名称',
  PRIMARY KEY (`auth_id`)
) ENGINE=InnoDB AUTO_INCREMENT=70 DEFAULT CHARSET=utf8 COMMENT='权限表';

