#
# Structure for table "order"
#

DROP TABLE IF EXISTS `order`;
CREATE TABLE `order` (
  `order_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `user_id` mediumint(8) unsigned NOT NULL COMMENT '用户ID',
  `order_number` varchar(32) NOT NULL COMMENT '订单编号',
  `total_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '账单总金额',
  `order_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '提现金额',
  `free_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '账单剩余金额',
  `bank_information` varchar(32) DEFAULT NULL COMMENT '银行卡',
  `alipay` varchar(20) DEFAULT NULL COMMENT '支付宝',
  `order_pay` tinyint(4) NOT NULL DEFAULT '0' COMMENT '支付方式,0:支付宝,1:微信,2:银行卡快捷支付',
  `order_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '订单状态:0,未付款,1:已付款,2:未确认[表示已支付]',
  `created_time` int(10) unsigned NOT NULL COMMENT '订单记录生成时间',
  `updated_time` int(10) unsigned NOT NULL COMMENT '订单记录修改时间',
  `notice` varchar(20) DEFAULT NULL COMMENT '提现通知',
  PRIMARY KEY (`order_id`),
  UNIQUE KEY `order_number` (`order_number`),
  KEY `created_time` (`created_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单表';

