#
# Structure for table "t_nn_room_list"
#

DROP TABLE IF EXISTS `t_nn_room_list`;
CREATE TABLE `t_nn_room_list` (
  `id` bigint(11) unsigned NOT NULL AUTO_INCREMENT,
  `no` int(11) NOT NULL DEFAULT '0',
  `owner_id` int(11) NOT NULL DEFAULT '0',
  `create_timestamp` bigint(11) NOT NULL DEFAULT '0',
  `game` int(11) NOT NULL DEFAULT '0' COMMENT '已经玩了几局',
  `total_game` int(11) NOT NULL DEFAULT '0' COMMENT '总局数',
  `state` int(11) NOT NULL DEFAULT '1' COMMENT '1-开放、2-关闭',
  `rule_list` varchar(1024) NOT NULL DEFAULT '',
  `user1` int(11) NOT NULL DEFAULT '0',
  `score1` int(11) NOT NULL DEFAULT '0',
  `user2` int(11) NOT NULL DEFAULT '0',
  `score2` int(11) NOT NULL DEFAULT '0',
  `user3` int(11) NOT NULL DEFAULT '0',
  `score3` int(11) NOT NULL DEFAULT '0',
  `user4` int(11) NOT NULL DEFAULT '0',
  `score4` int(11) NOT NULL DEFAULT '0',
  `user5` int(11) NOT NULL DEFAULT '0',
  `score5` int(11) NOT NULL DEFAULT '0',
  `user6` int(11) NOT NULL DEFAULT '0',
  `score6` int(11) NOT NULL DEFAULT '0',
  `user7` int(11) NOT NULL DEFAULT '0',
  `score7` int(11) NOT NULL DEFAULT '0',
  `user8` int(11) NOT NULL DEFAULT '0',
  `score8` int(11) NOT NULL DEFAULT '0',
  `user9` int(11) NOT NULL DEFAULT '0',
  `score9` int(11) NOT NULL DEFAULT '0',
  `user10` int(11) NOT NULL DEFAULT '0',
  `score10` int(11) NOT NULL DEFAULT '0',
  `user11` int(11) NOT NULL DEFAULT '0',
  `score11` int(11) NOT NULL DEFAULT '0',
  `user12` int(11) NOT NULL DEFAULT '0',
  `score12` int(11) NOT NULL DEFAULT '0',
  `guildId` int(11) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1355 DEFAULT CHARSET=utf8;

