#
# Structure for table "t_user_list"
#

DROP TABLE IF EXISTS `t_user_list`;
CREATE TABLE `t_user_list` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(32) NOT NULL DEFAULT '',
  `icon` varchar(255) NOT NULL DEFAULT '',
  `token` bigint(11) NOT NULL DEFAULT '0',
  `gender` int(11) NOT NULL DEFAULT '1',
  `register_timestamp` bigint(11) NOT NULL DEFAULT '0',
  `game_count` bigint(11) NOT NULL DEFAULT '0',
  `invitation_code` int(11) NOT NULL DEFAULT '0',
  `cur_room_no` int(11) NOT NULL DEFAULT '0',
  `guild_info` varchar(2048) NOT NULL DEFAULT '',
  `tokenCode` varchar(512) NOT NULL DEFAULT '',
  `ip_addr` varchar(128) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=999838 DEFAULT CHARSET=utf8;

